data:
  definition: installation connectée à un réseau de télécommunication et qui assure
    l'accès à un ou plusieurs services fournis par ce réseau
  examples: []
  notes:
  - 'Un terminal peut être qualifié pour indiquer le type de service assuré ou le
    type d''usager; par exemple: "terminal de données", "terminal d''abonné".'
